// Helpers for status styling
function getStatusVariant(status) {
    switch(status){
        case 'ACTIVE':
            return 'default'; // Using default (primary color) for Active
        case 'PENDING':
            return 'secondary';
        case 'BLACKLISTED':
            return 'destructive';
        default:
            return 'outline';
    }
}
